- Definition of the accounting and analytical account charter - for a private passenger transport company from [customer];
- Definition of rules allowing the standardized use of the charter of accounts;
- Collection of functional analysis needs;
- Definition of indicators for the automation of report production;
- Organization and monitoring of the implementation of new management rules., ** Support in the redefinition of the charter of accounts, as part of the establishment of a supply tool ([customer]) - for a company in the agrifood sector **
