- Redefinition of the various segments constituting the charter of accounts;
- Acorbering accounting accounts
- Support on mapping between the account charter and taxonomy;
- Analysis of the cost of cost - for a company specializing in making outdoor clothing;
- audit of the methodology used and systems;
- Analysis of different processes impacting the cost of cost: Inventory process purchasing process, sales process;
- Drafting of a report presenting the differences in exemplary practices and recommendations., ** Support for the recruitment process [from the strategic planning phase to the integration phase of employees] - for a school board **
- Workshop animation with recruitment teams;
- Analysis of the stages of the value chain on its various aspects: Governance delivery model, people, processes, tools, data;
- Proposal for a target process., ** Redefinition of processes in order to improve and simplify communication between operational and finance for a maritime transport company **
- mapping of financial processes and presentation of exemplary practices;
- examination of systems [oracle];
- Analysis of differences to exemplary practices and recommendations., ** Help for the selection of a new integrated management software for a lucrative organization which contributes to the development and optimization of recycling **
